import React, {Component} from 'react';
import {ListGroup, ListGroupItem} from 'reactstrap';
class Category extends Component {
    render() {
        return (
            <div className="category">
                <ListGroup>
                    <ListGroupItem className="items2"><a href="" className="links2">Lorem ipsum
                        dolor.</a></ListGroupItem><ListGroupItem className="items2"><a href="" className="links2">Animi
                    dolorem, velit.</a></ListGroupItem><ListGroupItem className="items2"><a href="" className="links2">Ex,
                    praesentium tenetur!</a></ListGroupItem><ListGroupItem className="items2"><a href=""
                                                                                                 className="links2">Eveniet,
                    maxime, porro.</a></ListGroupItem><ListGroupItem className="items2"><a href="" className="links2">A,
                    eius, optio!</a></ListGroupItem><ListGroupItem className="items2"><a href="" className="links2">Aliquid,
                    necessitatibus, quas.</a></ListGroupItem><ListGroupItem className="items2"><a href=""
                                                                                                  className="links2">Esse
                    ipsam, nam.</a></ListGroupItem><ListGroupItem className="items2"><a href="" className="links2">Aliquam
                    expedita, ratione?</a></ListGroupItem><ListGroupItem className="items2"><a href=""
                                                                                               className="links2">Error,
                    iste rerum.</a></ListGroupItem><ListGroupItem className="items2"><a href="" className="links2">Eveniet,
                    nam saepe!</a></ListGroupItem>
                </ListGroup>
            </div>
        );
    }
}

export default Category;
